  \"2015-02-04T19:17:06.890505\",\n\t\"name\": \"veterans-employment-metrics-ce63a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains information on veterans
  provided with workforce services from the Maryland Department of Labor, Licensing
  and Regulation.  Metrics include veterans those that went on to enter employment
  after ending participation in workforce services, those that did not go on to enter
  employment, and the rate at which those ending participation in workforce services
  entered employment.  Additionally, it includes veterans still employed after 6 months,
  those not still employed after 6 months, and the rate at which veterans retained
  employment after 6 months. Workforce services are provided through the Maryland
  Workforce Exchange or through One-Stop Career Centers.\",\n\t\"license_title\":
